using Harmony;
using System;
using System.Collections;
using System.IO;
using System.Linq;
using TMPro;
using UnityEngine;
using UnityEngine.UI;
using System.Reflection;

[ModTitle("BetterItemDrops")] // The mod name.
[ModDescription("Adds better item drops to the game by adding an icon, the amount and adding a new cardbox model!")] // Short description for the mod.
[ModAuthor("TeKGameR950")] // The author name of the mod.
[ModIconUrl("https://i.imgur.com/oaFubly.png")] // An icon for your mod. Its recommended to be 128x128px and in .jpg format.
[ModWallpaperUrl("https://i.imgur.com/b8g8yEc.png")] // A banner for your mod. Its recommended to be 330x100px and in .jpg format.
[ModVersionCheckUrl("https://raftmodding.com/api/v1/mods/better-item-drops/version.txt")] // This is for update checking. Needs to be a .txt file with the latest mod version.
[ModVersion("1.1")] // This is the mod version.
[RaftVersion("Update 11")] // This is the recommended raft version.
[ModIsPermanent(true)] // If your mod add new blocks, new items or just content you should set that to true. It loads the mod on start and prevents unloading.
public class BetterItemDrops : Mod
{
    public static GameObject dropboxPrefab;
    AssetBundle asset;
    public static Shader shader;
    HarmonyInstance HARMONY_INSTANCE;
    string HARMONY_ID = "fr.tekgamer.betteritemdrops";

    public IEnumerator Start()
    {
        AssetBundleCreateRequest request = AssetBundle.LoadFromMemoryAsync(Convert.FromBase64String(embeddedAssetBundle.data));
        yield return request;
        asset = request.assetBundle;

        HARMONY_INSTANCE = HarmonyInstance.Create(HARMONY_ID);
        HARMONY_INSTANCE.PatchAll(Assembly.GetExecutingAssembly());

        dropboxPrefab = asset.LoadAsset<GameObject>("BetterDropBox");
        dropboxPrefab.AddComponent<BetterItemDrop>();
        RConsole.Log("BetterItemDrops has been loaded!");
        shader = asset.LoadAsset<Material>("ExampleMaterial").shader;
        Traverse.Create(typeof(PickupObjectManager)).Field("dropboxPrefabStatic").SetValue(dropboxPrefab);
    }

    public override void WorldEvent_WorldLoaded(){
        Traverse.Create(typeof(PickupObjectManager)).Field("dropboxPrefabStatic").SetValue(dropboxPrefab);
    }

    public void OnModUnload()
    {
        if (asset)
        {
            asset.Unload(true);
        }
        RConsole.Log("BetterItemDrops has been unloaded!");
        Destroy(gameObject);
    }
}

public class BetterItemDrop : MonoBehaviour
{
    public void Start()
    {
        PickupItem pickup = GetComponent<PickupItem>();
        Material m = new Material(BetterItemDrops.shader);
        m.mainTexture = pickup.itemInstance.settings_Inventory.Sprite.texture.name == "ItemIcons" ? GetTextureFromSprite(pickup.itemInstance.settings_Inventory.Sprite) : pickup.itemInstance.settings_Inventory.Sprite.texture;
        StandardShaderUtils.ChangeRenderMode(m, StandardShaderUtils.BlendMode.Transparent);
        transform.GetComponentsInChildren<Renderer>().ToList().ForEach((r) =>
        {
            if (r.gameObject.name != "model" && r.gameObject.name != "Text") { r.material = m; }
        });
        transform.GetComponentsInChildren<TextMeshPro>().ToList().ForEach((te) => te.text = "x" + pickup.itemInstance.Amount);
    }

    public Texture2D GetTextureFromSprite(Sprite sprite)
    {
        Texture2D nonReadable = sprite.texture;
        RenderTexture tmp = RenderTexture.GetTemporary(nonReadable.width, nonReadable.height, 0, RenderTextureFormat.Default, RenderTextureReadWrite.sRGB);
        Graphics.Blit(nonReadable, tmp);
        RenderTexture previous = RenderTexture.active;
        RenderTexture.active = tmp;
        Texture2D readable = new Texture2D(nonReadable.width, nonReadable.height);
        readable.ReadPixels(new Rect(0, 0, tmp.width, tmp.height), 0, 0);
        readable.Apply();
        RenderTexture.active = previous;
        RenderTexture.ReleaseTemporary(tmp);
        var croppedTexture = new Texture2D((int)sprite.rect.width, (int)sprite.rect.height);
        var pixels = readable.GetPixels((int)sprite.textureRect.x, (int)sprite.textureRect.y, (int)sprite.textureRect.width, (int)sprite.textureRect.height);
        if (croppedTexture.width != 64)
        {
            return GetTextureFromSprite(ItemManager.GetItemByIndex(236).settings_Inventory.Sprite);
        }
        croppedTexture.SetPixels(pixels);
        croppedTexture.Apply();
        return croppedTexture;

    }
}
public static class StandardShaderUtils
{
    public enum BlendMode
    {
        Opaque,
        Cutout,
        Fade,
        Transparent
    }

    public static void ChangeRenderMode(Material standardShaderMaterial, BlendMode blendMode)
    {
        switch (blendMode)
        {
            case BlendMode.Opaque:
                standardShaderMaterial.SetInt("_SrcBlend", (int)UnityEngine.Rendering.BlendMode.One);
                standardShaderMaterial.SetInt("_DstBlend", (int)UnityEngine.Rendering.BlendMode.Zero);
                standardShaderMaterial.SetInt("_ZWrite", 1);
                standardShaderMaterial.DisableKeyword("_ALPHATEST_ON");
                standardShaderMaterial.DisableKeyword("_ALPHABLEND_ON");
                standardShaderMaterial.DisableKeyword("_ALPHAPREMULTIPLY_ON");
                standardShaderMaterial.renderQueue = 1000;
                break;
            case BlendMode.Cutout:
                standardShaderMaterial.SetInt("_SrcBlend", (int)UnityEngine.Rendering.BlendMode.One);
                standardShaderMaterial.SetInt("_DstBlend", (int)UnityEngine.Rendering.BlendMode.Zero);
                standardShaderMaterial.SetInt("_ZWrite", 1);
                standardShaderMaterial.EnableKeyword("_ALPHATEST_ON");
                standardShaderMaterial.DisableKeyword("_ALPHABLEND_ON");
                standardShaderMaterial.DisableKeyword("_ALPHAPREMULTIPLY_ON");
                standardShaderMaterial.renderQueue = 1000;
                break;
            case BlendMode.Fade:
                standardShaderMaterial.SetInt("_SrcBlend", (int)UnityEngine.Rendering.BlendMode.SrcAlpha);
                standardShaderMaterial.SetInt("_DstBlend", (int)UnityEngine.Rendering.BlendMode.OneMinusSrcAlpha);
                standardShaderMaterial.SetInt("_ZWrite", 0);
                standardShaderMaterial.DisableKeyword("_ALPHATEST_ON");
                standardShaderMaterial.EnableKeyword("_ALPHABLEND_ON");
                standardShaderMaterial.DisableKeyword("_ALPHAPREMULTIPLY_ON");
                standardShaderMaterial.renderQueue = 1000;
                break;
            case BlendMode.Transparent:
                standardShaderMaterial.SetInt("_SrcBlend", (int)UnityEngine.Rendering.BlendMode.One);
                standardShaderMaterial.SetInt("_DstBlend", (int)UnityEngine.Rendering.BlendMode.OneMinusSrcAlpha);
                standardShaderMaterial.SetInt("_ZWrite", 0);
                standardShaderMaterial.DisableKeyword("_ALPHATEST_ON");
                standardShaderMaterial.DisableKeyword("_ALPHABLEND_ON");
                standardShaderMaterial.EnableKeyword("_ALPHAPREMULTIPLY_ON");
                standardShaderMaterial.renderQueue = 1000;
                break;
        }

    }
}

